import logo from './img/LocalendarLogo.svg';
import './App.css';

function App() {
  return (
    <div className='home'>
      <div className='logo-div'>
        <img src={logo} alt='logo' className='logo-homepage'/>
      </div> 
      <div className='login-box'>
        <p>this is some text where the login would go</p>
      </div>
    </div>
  );
}

class LoginBox extends React.Component {
  render() {
    return (
      <p>Login stuff goes here!!!</p>
    );
  }
}

export default App;
